using namespace std;
int m ,k;
int n;
long long x;
class node{
public:
    node *a, *b;
    long long bitmask;
    node(){
        a = NULL;
        b = NULL;
        bitmask = 0;
    }
};
int ret;
string curr;
void rek(int at, int depth, node *tmp){
    tmp -> bitmask |= x;
    int popcount = __builtin_popcount(tmp -> bitmask);
    if(popcount == n && depth > ret){
        ret = depth;
    }
    if(at == (int)curr.size() || depth > 60){
        return;
    }
    if(curr[at] == 'a'){
        if(tmp -> a == NULL){
            tmp -> a = new node();
        }
        rek(at + 1, depth + 1, tmp -> a);
    }
    else{
        if(tmp -> b == NULL){
            tmp -> b = new node();
        }
        rek(at + 1, depth + 1, tmp -> b);
    }
}
