	}
}

int conversion(const char x){
		
	int aux;
		
	for(int i=0; i<32; i++){
		if(x == symbols[i]){
			aux = i;
			break;
		}
	}
		
	return values[aux];
}

char successor(const char x){
	
	int aux;
	char y;
	
	aux = conversion(x);
	
	if(aux == 31){
		aux = 0;
		mod = 1;
	}
	
	y = next[aux];
	
	return y;
}

char plus(const char x, const char y){
	
	int aux, aux2;
	char z;
	
	aux = conversion(x);
	aux2 = conversion(y);
	z = x;
	
	while(aux2){
		z = successor(z);
		aux2--;
	}
	
	return z;
}

void a_plus_b_equals_c(const numberx32 *a, const  numberx32 *b, numberx32 *c){
	
	char x, y, z;
	int aux;
	
	for(int i=0; i<SIZE; i++){
		
		aux = temp[i];
		mod_reset();
		
		x = a->digits[i];
		y = b->digits[i];
		z = c->digits[i];
		
		z = plus(x, y);
		if(i < (SIZE-1)) temp[i+1] = mod;
		if(temp[i] != 0) z = successor(z);
		c->digits[i] = z;
		
	}
	
}

int main(void){
	
	numberx32 a, b, c;
	char aux[10];
		
	printf("Number #1: ");
	read_str(aux, a.digits);
	printf("\n%s\n", a.digits);
	
	printf("\nNumber #2: ");
	read_str(aux, b.digits);
	printf("\n%s\n", b.digits);
	
	a_plus_b_equals_c(&a, &b, &c);
	
	printf("\n\nResult: %s\n", c.digits);
	
