; register for rawinput
_size := 8 + A_PtrSize
RIDEV_INPUTSINK := 0x00000100
VarSetCapacity(RAWINPUTDEVICE, _size)
NumPut(1, RAWINPUTDEVICE, 0, "UShort")
NumPut(2, RAWINPUTDEVICE, 2, "UShort")
NumPut(RIDEV_INPUTSINK, RAWINPUTDEVICE, 4, "Uint")
Gui +hwndhwnd
